import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { TailSpin } from 'react-loader-spinner';
import {
  Input, Select,
  initTE,
} from 'tw-elements';
// import './comp1.css'
const Component1 = ({ onSubmit, org }) => {
  const [formData, setFormData] = useState({
    project: '',
    project_type: '',
    project_role: '',
    organization_name: org,
    industry_domains: 'Retail',
    funnel_stages: '',
    manage: '',
  });
  const [isFormValid, setIsFormValid] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [isProjectRegistered, setIsProjectRegistered] = useState('');

  const checkProjectRegistration = async () => {
    setIsLoading(true);
    try {
      const response = await axios.post('http://localhost:3001/check-project', {
        project: formData.project,
      });

      const data = response.data;
      const { details } = data;
      return details;
    } catch (error) {
      console.error('Error checking project registration:', error);
    } finally {
      setIsLoading(false);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (isFormValid) {
      const result = await checkProjectRegistration();
      if (result !== formData.project) {
        // changeId(2);
        onSubmit(formData);
        generateEmptyFormData();
      } else {
        setIsProjectRegistered('Project Exists');
      }
    }
  };

  const generateEmptyFormData = () => ({
    project: '',
    project_type: '',
    project_role: '',
    organization_name: '',
    industry_domains: '',
    funnel_stages: '',
    manage: '', // Default value added
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevFormData) => ({
      ...prevFormData,
      [name]: value,
    }));
  };
  useEffect(() => {
    initTE({ Input, Select });
  }, []);

  useEffect(() => {
    const form = document.getElementById('componentForm');
    setIsFormValid(
      Object.values(formData).every((value) => value !== '') && form.checkValidity()
    );
  }, [formData]);

  return (
    <form
      id="componentForm"
      className="text-left max-w-full p-5 rounded-[5px]"
      onSubmit={handleSubmit}
    >
      <h2>Create a project</h2>
      <br />
      <div className="flex">
      <div class="relative mb-3" data-te-input-wrapper-init>
        <input
          type="text"
          class="peer block min-h-[auto] w-full rounded border-0 bg-transparent px-3 py-[0.32rem] leading-[1.6] outline-none transition-all duration-200 ease-linear focus:placeholder:opacity-100 peer-focus:text-primary data-[te-input-state-active]:placeholder:opacity-100 motion-reduce:transition-none dark:text-neutral-200 dark:placeholder:text-neutral-200 dark:peer-focus:text-primary [&:not([data-te-input-placeholder-active])]:placeholder:opacity-0 w-96 h-3"
          id="exampleFormControlInput1"
          placeholder="Name of the project" 
            name="project"
            value={formData.project}
            onChange={handleInputChange}
            required />
        <label
          for="exampleFormControlInput1"
          class="pointer-events-none absolute left-3 top-0 mb-0 max-w-[90%] origin-[0_0] truncate pt-[0.37rem] leading-[1.6] text-neutral-500 transition-all duration-200 ease-out peer-focus:-translate-y-[0.9rem] peer-focus:scale-[0.8] peer-focus:text-primary peer-data-[te-input-state-active]:-translate-y-[0.9rem] peer-data-[te-input-state-active]:scale-[0.8] motion-reduce:transition-none dark:text-neutral-200 dark:peer-focus:text-primary"
          >Name of the Project
        </label>
      </div>
        {/* <div className="w-6/12">
          <h3 className="inline-block">Name</h3>
          <br />
          <input
            className="min-w-[200px] w-full max-w-[400px] mb-4 p-2 rounded-[5px] border-[#333] border-[solid]"
            type="text"
            name="project"
            value={formData.project}
            onChange={handleInputChange}
            required
          />
        </div> */}

        <div className="w-6/12">
        <select data-te-select-init name="project_type" className='w-64 h-10'
            value={formData.project_type}
            onChange={handleInputChange}
            required>
          <option value="" disabled>Select Type of project</option>
          <option value="User Application">User Application</option>
          <option value="SDK">SDK</option>
          <option value="Protocol Stack">Protocol Stack</option>
        </select>

          {/* <select
            className="min-w-[200px] w-full max-w-[400px] mb-4 p-2 rounded-[5px]"
            name="project_type"
            value={formData.project_type}
            onChange={handleInputChange}
            required
          >
            <option value="" disabled hidden>
              Select a type of project
            </option>
            <option value="User Application">User Application</option>
            <option value="SDK">SDK</option>
            <option value="Protocol Stack">Protocol Stack</option>
          </select> */}
        </div>
      </div>

      <div className="flex">
        <div className="w-6/12">
          <h3 className="inline-block">Select Your Role</h3>
          <br />
          <select
            className="min-w-[200px] w-full max-w-[400px] mb-4 p-2 rounded-[5px]"
            name="project_role"
            value={formData.project_role}
            onChange={handleInputChange}
            required
          >
            <option value="" disabled hidden>
              Select your role
            </option>
            <option value="BAP">BAP</option>
            <option value="BPP">BPP</option>
            <option value="Beckn Gateway">Beckn Gateway</option>
            <option value="Beckn Registry">Beckn Registry</option>
          </select>
        </div>

        <div className="w-6/12">
          <h3 className="inline-block">Organization Name</h3>
          <br />
          <input
            className="min-w-[200px] w-full max-w-[400px] mb-4 p-2 rounded-[5px] border-[#333] border-[solid]"
            type="text"
            name="organization_name"
            value={formData.organization_name}
            onChange={handleInputChange}
            required
          />
        </div>
      </div>

      <div className="flex">
        <div className="w-6/12">
          <h3 className="inline-block">Industry Domain</h3>
          <br />
          <select
            className="min-w-[200px] w-full max-w-[400px] mb-4 p-2 rounded-[5px]"
            name="industry_domains"
            value={formData.industry_domain}
            onChange={handleInputChange}
            required
          >
            <option value="" disabled hidden>
              Select Industry Domain
            </option>
            <option value="Retail">Retail</option>
            <option value="Logistics">Logistics</option>
            <option value="Healthcare">Healthcare</option>
            <option value="Mobility">Mobility</option>
          </select>
        </div>

        <div className="w-6/12">
          <h3 className="inline-block">Funnel Stages</h3>
          <br />
          <select
            className="min-w-[200px] w-full max-w-[400px] mb-4 p-2 rounded-[5px]"
            name="funnel_stages"
            value={formData.funnel_stages}
            onChange={handleInputChange}
            required
          >
            <option value="" disabled hidden>
              Select Funnel Stages
            </option>
            <option value="Package 1">Package 1</option>
            <option value="Package 2">Package 2</option>
            <option value="Package 3">Package 3</option>
            <option value="Package 4">Package 4</option>
          </select>
        </div>
      </div>

      <h3>Do you want to manage?</h3>
      <div className="flex">
        <button
          type="button"
          name="manage"
          value="1"
          className={`cursor-pointer font-[bold] w-[200px] text-[#333] m-1 px-4 py-2 rounded-[5px]  ${formData.manage === '1' ? 'bg-[green] text-white' : ' bg-transparent border-green border-2 text-black'}`}
          onClick={handleInputChange}
        >
          Yes
        </button>
        <button
          type="button"
          name="manage"
          value="0"
          className={`cursor-pointer font-[bold] w-[200px] text-[#333] m-1 px-4 py-2 rounded-[5px] ${formData.manage === '0' ? 'bg-[red] text-white' : ' bg-transparent border-red border-2 text-black'}`}
          onClick={handleInputChange}
        >
          No
        </button>
      </div>
      <button className="bg-[red] cursor-pointer text-[white] font-[bold] p-2 rounded-[5px] border-[none] active:scale-[0.8]" disabled={!isFormValid}>
        Save and Proceed
      </button>
      {isLoading && (
        <TailSpin type="ThreeDots" color="#00BFFF" height={50} width={50} />
      )}
      {!isFormValid && <p>Fill in the details</p>}
      <p>{isProjectRegistered}</p>
    </form>
  );
};

